import React, { useState } from 'react';
import { Layout, Button, Typography, Dropdown, Avatar, Menu } from 'antd';
import { 
  UserOutlined, 
  LogoutOutlined, 
  DashboardOutlined, 
  ToolOutlined,
  GlobalOutlined
} from '@ant-design/icons';
import { Outlet, useNavigate, useLocation } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import '../styles/DashboardLayout.css';

const { Header, Content, Sider } = Layout;
const { Text } = Typography;

const DashboardLayout: React.FC = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();
  const location = useLocation();
  const [collapsed, setCollapsed] = useState(false);

  const handleLogout = async () => {
    await logout();
    navigate('/login');
  };

  const userMenuItems = [
    {
      key: 'profile',
      label: (
        <div style={{ padding: '8px 16px' }}>
          <div style={{ fontWeight: 'bold' }}>{user?.username}</div>
          <div style={{ fontSize: '12px', color: '#8b8d97' }}>{user?.email}</div>
        </div>
      ),
    },
    {
      key: 'logout',
      label: (
        <Button 
          type="text" 
          icon={<LogoutOutlined />} 
          onClick={handleLogout}
          style={{ width: '100%', textAlign: 'left' }}
        >
          ÈÄÄÂá∫ÁôªÂΩï
        </Button>
      ),
    },
  ];

  // Ëé∑ÂèñÂΩìÂâçË∑ØÂæÑÔºåÁî®‰∫éÈ´ò‰∫ÆÊòæÁ§∫ÂΩìÂâçËèúÂçïÈ°π
  const getSelectedKey = () => {
    const path = location.pathname;
    if (path.startsWith('/dashboard')) return ['dashboard'];
    if (path.startsWith('/tools/mcp')) return ['mcp'];
    return ['dashboard'];
  };

  return (
    <Layout className="dashboard-layout">
      <Header className="dashboard-header">
        <div className="logo-container">
          <div className="logo-icon">üìä</div>
          <div className="logo-text">StockInsight</div>
        </div>

        <div className="header-right">
          <Dropdown menu={{ items: userMenuItems }} placement="bottomRight">
            <div className="user-info">
              <Avatar icon={<UserOutlined />} />
              <span className="username">{user?.username}</span>
            </div>
          </Dropdown>
        </div>
      </Header>

      <Layout>
        <Sider 
          collapsible 
          collapsed={collapsed} 
          onCollapse={(value) => setCollapsed(value)}
          theme="dark"
          style={{ background: '#2a2d3a' }}
        >
          <Menu
            theme="dark"
            mode="inline"
            selectedKeys={getSelectedKey()}
            style={{ background: '#2a2d3a', marginTop: '16px' }}
            items={[
              {
                key: 'dashboard',
                icon: <DashboardOutlined />,
                label: '‰ª™Ë°®Áõò',
                onClick: () => navigate('/dashboard')
              },
              {
                key: 'tools',
                icon: <ToolOutlined />,
                label: 'Â∑•ÂÖ∑',
                children: [
                  {
                    key: 'mcp',
                    icon: <GlobalOutlined />,
                    label: 'ÊµèËßàÂô®Ëá™Âä®Âåñ',
                    onClick: () => navigate('/tools/mcp')
                  }
                ]
              }
            ]}
          />
        </Sider>

        <Content className="dashboard-content">
          <Outlet />
        </Content>
      </Layout>

      <div className="dashboard-footer">
        <Text style={{ color: '#6b7280' }}>
          <span style={{ color: '#ef4444' }}>È£éÈô©ÊèêÁ§∫Ôºö</span>
          <span> ËÇ°Â∏ÇÊúâÈ£éÈô©ÔºåÊäïËµÑÈúÄË∞®ÊÖé„ÄÇÊú¨Á≥ªÁªü‰ªÖ‰æõÂèÇËÄÉÔºå‰∏çÊûÑÊàêÊäïËµÑÂª∫ËÆÆ„ÄÇ</span>
        </Text>
      </div>
    </Layout>
  );
};

export default DashboardLayout;
